Voyage: Ocean 
by John Woodward
DK Publishing | March 2009 | ISBN-10: 0756645484 | PDF | 128 pages | 64 mb &lt;a href=&quot;
http://www.amazon.com/Voyage-Ocean-John-Woodward/dp/0756645484&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.amazon.com/Voyage-Ocean-John-Woodward/dp/0756645484&lt;/a&gt;

A gorgeous follow-up to the innovative Mission: Space, Voyage: Ocean brings us back down to Earth and into the abyss of the deep, blue sea. Spectacular images take center stage as we explore the incredible ocean and the animals and plants that live there.
Special spreads focus on man s interaction with and exploration of the ocean, explaining up-to-the minute scientific advances and developments.
Informative text interacts with the imagery throughout this circular tome, making it an asset to any library, be it at home, school, aquarium, or beyond.
